import React from 'react'

class About extends React.Component {
    render() {
        return(
            <div className='about'>
                <div className='about__container'>
                    <div className='about__paragraphs'>
                    <p className='about__paragraph1'>First of all, thank you for visiting our page and supporting our dream!</p>
                    <p>Localify began with a dream of a city with an app to act as a support system to the local/independent shops. 
                        Our goal is to make it easy for visitors and locals to find and explore places that originated in the city they are situated in. Rather than supplying information about chains, and big brands Localify focuses on small local operations.
                    </p>
                    </div>

                </div>
            </div>
        )
    }
}
export default About
